function TabSection(props) {
  return (
    <>
      <div>Working {props.tabName}</div>
      <div className="content">
        {props.tabContent}
      </div>
    </>
  )
}

function Practice1Tab() {
  return (
    <>
      <section className='container'>
        <TabSection tabName={"Why React?"} tabContent={"Component-based architecture: React follows a component-based architecture, allowing developers to build UI elements as reusable and self-contained components. This promotes code reusability, modularity, and easier maintenance."} />
      </section>
    </>
  )
}

export default Practice1Tab;
